import React from 'react';
import { BrowserRouter, Route, Switch, useRouteMatch } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import Ident from '../Identification/Identification'


function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/x">
        Nic
        </Route>

        <Route exact path="/x/test">
        Test
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
